name: PrusaSlicer
version: 2.3.3+win64

alerts:
  E01: |
    Error (Invalid 3MF format) while parsing '{filename}' at line {line}
  E03: |
    Error (duplicate attribute) while parsing '{filename}' at line {line}
  E04: |
    The supplied file couldn't be read because it's empty
  E05: |
    Error (out of memory) while parsing '{filename}' at line {line}
  E08: |
    Error (reference to external entity in attribute) while parsing '{filename}' at line {line}
  E09: |
    Error (syntax error) while parsing '{filename}' at line {line}
  W02: |
    Your object appears to be too large, so it was automatically scaled down to fit your print bed.
  W06: |
    An object outside the print area was detected.
  W07: |
    Some objects(s) in {file} looks like saved in inches.
    Should I consider them as saved in inches and convert them?

